import React from "react";
import { Button, Container,TextField} from "@material-ui/core";
import DeleteIcon from "@material-ui/icons/Delete";
import {
  Card,
  CardActionArea,
  CardMedia,
  makeStyles,
  CardContent,
  Typography,
  AppBar,
  Toolbar,
} from "@material-ui/core";
const useStyles = makeStyles((theme) => ({
  button: { ...theme.mybutton },
  nav: { ...theme.myNav },
  small: {
    display: "none",
    [theme.breakpoints.up("sm")]: {
      display: "block",
    },
  },
  large: {
    display: "block",
    [theme.breakpoints.up("sm")]: {
      display: "none",
    },
  },
}));
export default function Signup() {
  const classes = useStyles();
  return (
    <>
      <AppBar>
        <Toolbar className={classes.nav}>
          <Typography variant="h6" className={classes.small}>
            E-COMMERCE
          </Typography>
          <Typography variant="h6" className={classes.large}>
            E-COM
          </Typography>
          <div>
            <Button
              variant="contained"
              color="success"
              className={classes.button}
            >
              Log in
            </Button>
            <Button
              variant="contained"
              color="success"
              className={classes.button}
            >
              Sign up
            </Button>
          </div>
        </Toolbar>
      </AppBar>
      <Container>
        <Typography variant="h1">welcome to my world</Typography>
      </Container>
      <Card>
        <CardContent>
        <form className={classes.root} noValidate autoComplete="off">
   <TextField id="filled-basic" label="Email Address" variant="outlined" /><br/>
  <TextField id="outlined-basic" label="Password" variant="outlined" />
  <TextField id="outlined-basic" label="Confirm Password" variant="outlined" />
</form>
        </CardContent>
        <CardActionArea>
          <Button variant="contained" color="primary">
            Login
          </Button>
        </CardActionArea>
      </Card>
    </>
  );
}
